import React, { useState } from 'react'
import InputFields from '../components/InputFields'
import Expensetracker from '../assets/expenseTracker.PNG'
import TextField from '@mui/material/TextField'
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
import InputLabel from '@mui/material/InputLabel';
import Select from '@mui/material/Select';

const ExpenseTracker = () => {
    const [Type, setType] = useState('')

    const handleChange = (event) => {
        setType(event.target.value);
    }

    return (
        <div>
            <img src={Expensetracker} className='float-right' alt='img' />
            <div className='w-1/2 h-full float-left text-center' style={{ marginTop: '3rem' }}>
                <h1 className='text-indigo-900	text-6xl'>Expense Manager</h1>
                <div className='container w/1/2 outline-black' style={{ marginTop: '4rem', marginLeft: '4rem' }}>
                    <div className='grid p-12'>
                        <TextField
                            label="Size"
                            id="standard-size-normal"
                            variant="standard"
                            className='row'
                        />

                        <FormControl variant="standard" sx={{ m: 1, minWidth: 360 }} className='row'>
                            <InputLabel>Transaction Type</InputLabel>
                            <Select
                                id="Transaction_type"
                                value={Type}
                                onChange={handleChange}
                                label="Transaction Type"
                                className='w-full'
                            >
                                <MenuItem value='+'>Credit</MenuItem>
                                <MenuItem value='-'>Debit</MenuItem>
                            </Select>
                        </FormControl>
                    </div>
                </div>
            </div>


        </div>
    )
}

export default ExpenseTracker
